import React, { useState, useEffect } from "react";
import { Link } from "react-scroll";
import './Navbar.css';

const Navbar = () => {
  const [sticky, setSticky] = useState(false);

  useEffect(() => {

    window.addEventListener('scroll', () => {
      window.scrollY>50?setSticky(true):setSticky(false);
    })
  }, []);

  return (
    
    <nav className={navBackground ? "navbar active" : "navbar"}>
      <div className="logo"><img src="./images/logo.png" alt="logo" className='logo'/>
</div>
      <ul className="nav-links">
        <li>
          <Link
            activeClass="active"
            to="home"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            home
          </Link>
        </li>
        <li>
          <Link
            activeClass="active"
            to="about"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            about
          </Link>
        </li>
        <li>
          <Link
            activeClass="active"
            to="faq"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            FAQ
          </Link>
        </li>
        <li><button className="login-btn">login</button></li>
        <li><button className="signup-btn">signup</button></li>
      </ul>
    </nav>
  );
};

export default Navbar;
